function Home(){
    return (
        <>
            <div id="home" class="home">
                <div class="effect">
                    <h1>Manar Elbeshbishy</h1>
                </div>
                    
                <div>
                    <button><a href="#about">About</a></button>
                    <button><a href="#projects">Projects</a></button>
                    <button><a href="#education">Education</a></button>
                    <button><a href="#contact">Contact</a></button>
                </div>
                
            </div>
        </>
    );
}
export default Home;
